// src/components/Dashboard.js
import React from 'react';
import Sidebar from './Sidebar';
import { Box, Typography, Grid, Paper } from '@mui/material';

const Dashboard = () => {
  return (
    <Box sx={{ display: 'flex', minHeight: '100vh', backgroundColor: '#1e1e1e' }}>
      <Sidebar />
      <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff' }}>
        <Typography variant="h4" gutterBottom>
          Hello, [Student Name]!
        </Typography>

        {/* Section: Personalized Learning Goals */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Personalized Learning Goals</Typography>
          {/* Add personalized goals content here */}
        </Paper>

        {/* Section: Tutoring History */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Tutoring History</Typography>
          {/* Add tutoring history content here */}
        </Paper>

        {/* Section: Upcoming Sessions and Reminders */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Upcoming Sessions and Reminders</Typography>
          {/* Add upcoming sessions content here */}
        </Paper>

        {/* Section: Resources and Study Materials */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Resources and Study Materials</Typography>
          {/* Add resources content here */}
        </Paper>

        {/* Additional sections can be added similarly */}
      </Box>
    </Box>
  );
};

const paperStyle = {
  padding: '20px',
  marginBottom: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
};

export default Dashboard;
